import React from "react";
import { Col, Row, Container } from "react-bootstrap";
import './LabelLayout.css'
import SportLabel from "./SportLabel";

const LabelLayout = () => {
    // LIST OF COLORS
    // "badge yellow"
    // "badge orange"
    // "badge pink"
    // "badge red"
    // "badge purple"
    // "badge teal"
    // "badge blue"
    // "badge blue-dark"
    // "badge green"
    // "badge green-dark"
    // "badge silver"
    // "badge gold"

    return(
        <Container>
            <Row>
                <Col><SportLabel className= "badge yellow" symbol={<i class="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge yellow" symbol={<i class="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge yellow" symbol={<i class="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
            </Row>
            <Row>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
            </Row>
        </Container>
    )
    
}

export default LabelLayout;
